interface CustomRadioButtonProps {
  setValue: (id:string) => void
  active:boolean
  id:string
  label:string
}

export const CustomRadioButton = (props:CustomRadioButtonProps) => {
  const handleChangeValue = () => {
      props.setValue(props.id)
  }
  return (
  <label className="radio_container no_select" 
  // onClick={handleChangeValue}
  >
      {props.label}
  <input type="radio" checked={props.active} name={props.id} onChange={handleChangeValue}  className="custom_radio_input"/>
      <span className="radio_checkmark"></span>
  </label>
  )
}
